import React from "react";

export default function controls(props) {
  return (
    <div className='controls'>
      <button onClick={props.up} className='counter_up'>
        Counter + 1
      </button>
      <button onClick={props.down} className='counter_down'>
        Counter - 1
      </button>

      <input
        onKeyPress={(e) => {
          console.log(e.key());
        }}
      />
    </div>
  );
}
